import HourlyList from './ForcastList';
import CurrentForcast from './CurrentForcast';


const LocalList = (time, hourlyForcast, dailyForcast, error) => (
    < div >
        {hourlyForcast && <div> <CurrentForcast CurrentForcast={hourlyForcast} /></div>}
        {error && <p>Error: {error}</p>}
    </div >
);

export default LocalList;
